from time import sleep
from typing import List

class Solution:
    def numSubarrayProductLessThanK(self, nums: List[int], k: int) -> int:
        count = 0
        left = right = 0
        prod = 1
        while right < len(nums):
            if prod >= k:
                prod = prod / nums[left-1]
            else:
                prod = prod * nums[right]
            
            if prod >= k:
                left += 1
                if right < left:
                    right = left
                    prod = 1
            else:
                count += right - left + 1
                right += 1

        return count

def numSubarrayProductLessThanK(nums: List[int], k: int) -> int:
    print('***********************************')
    print(nums, k)
    sls = Solution()
    result = sls.numSubarrayProductLessThanK(nums, k)
    print('-----------------------')
    print(result)
    return result

assert numSubarrayProductLessThanK([10,2,3,5,7,100], 120) == 13, 'First'
assert numSubarrayProductLessThanK([10,5,2,6], 100) == 8, 'Second'
assert numSubarrayProductLessThanK([1,2,3], 0) == 0, 'Third'
assert numSubarrayProductLessThanK([], 10) == 0, 'Fourth'
assert numSubarrayProductLessThanK([100,100,100,100,100,100], 101) == 6, 'Fifth'
assert numSubarrayProductLessThanK([1,2,3,4,5,6], 10000) == 21, 'Sixth'
assert numSubarrayProductLessThanK([6,3,5,9], 60) == 7, 'Seventh'
